window.bookSummaryJSON = "<p>In a world full of darkness, the light of the sun is the only thing that can keep the Dark at bay. And dragons are the only thing that can protect the light.</p> <p><b>The first book in an epic dragon-rider series from international best-selling author Jada Fisher.</b></p> <p>Tennegan Felter (Ten) is a humble servant in Epoch Sol, a beacon of light in a world full of darkness. Her deepest desire is to serve the city she loves and defend it from the creatures of the Dark that live all around. The only way to do that is to join the Dragon Guard. There’s one big problem, though. She is a mere servant and faces near insurmountable odds just to get in. And then she has to pass all the tests. Can Ten prove her doubters wrong, overcome all the obstacles, and fulfill her dream of becoming a dragon rider?</p> <p><i>Trial by Fire</i> is the first book in the epic Dragon Guard fantasy adventure. If you enjoy magical worlds and unforgettable characters, you don't want to miss this epic adventure from best-selling author Jada Fisher.</p> <p>Listen to <i>Trial by Fire</i> and get lost in a world of magic and adventure.</p>"; 
